import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
     monstoers: [
      {
        name: 'Linda'
      },
      {
        name: 'Frank'
      },
      {
        name: 'Jacky'
      },
      {
        name: 'Mustafa'
      }
     ],
    };
  }
  render() {
    return (
      <div className="App">
      {
        this.state.monstoers
      }
      </div>
    );
  }
}

export default App;
